import React, { useState } from 'react';
import { Route, Routes, Navigate } from 'react-router-dom';
import Login from '../su/page/Login';
import Dashboard from './page/Dashboard';
import ManageDevice from './page/ManageDevice';
import ManageUsers from './page/ManageUsers';
import ManageUserRole from './page/ManageUserRole';
import ManageFinance from './page/ManageFinance';
import ManageReseller from './page/ManageReseller';
import Profile from './page/Profile';
import HardwareManagement from './page/HardwareManagement';
import PricingManagement from './page/PricingManagement';
import OccupantManagement from './page/OccupantManagement';
import AccessManagement from './page/AccessManagement';
import Sidebar from './components/Sidebar';

const SuperAdminApp = () => {
  const storedUser = JSON.parse(sessionStorage.getItem('user'));
  const [loggedIn, setLoggedIn] = useState(!!storedUser);
  const [userInfo, setUserInfo] = useState(storedUser || {});
  const [initialLoad, setInitialLoad] = useState(true);

  const handleLogin = (data) => {
    const { email, ...rest } = data;
    setUserInfo({ email, ...rest });
    setLoggedIn(true);
    sessionStorage.setItem('user', JSON.stringify({ email, ...rest }));
  };

  const handleLogout = () => {
    setLoggedIn(false);
    setUserInfo({});
    sessionStorage.removeItem('user');
  };

  return (
    <div className="app">
      {loggedIn && <Sidebar />}
      <div className="main-content">
        <Routes>
          <Route
            path="/"
            element={loggedIn ? <Navigate to="/Dashboard" /> : <Login handleLogin={handleLogin} />}
          />
          <Route
            path="/Dashboard"
            element={loggedIn ? (
              initialLoad ? (
                <Dashboard userInfo={userInfo} handleLogout={handleLogout} setInitialLoad={setInitialLoad} />
              ) : (
                <Dashboard userInfo={userInfo} handleLogout={handleLogout} />
              )
            ) : (
              <Navigate to="/" />
            )}
          />
          <Route
            path="/ManageDevice"
            element={loggedIn ? (
              <ManageDevice userInfo={userInfo} handleLogout={handleLogout} />
            ) : (
              <Navigate to="/" />
            )}
          />
          <Route
            path="/ManageUsers"
            element={loggedIn ? (
              <ManageUsers userInfo={userInfo} handleLogout={handleLogout} />
            ) : (
              <Navigate to="/" />
            )}
          />
          <Route
            path="/ManageUserRole"
            element={loggedIn ? (
              <ManageUserRole userInfo={userInfo} handleLogout={handleLogout} />
            ) : (
              <Navigate to="/" />
            )}
          />
          <Route
            path="/ManageFinance"
            element={loggedIn ? (
              <ManageFinance userInfo={userInfo} handleLogout={handleLogout} />
            ) : (
              <Navigate to="/" />
            )}
          />
          <Route
            path="/ManageReseller"
            element={loggedIn ? (
              <ManageReseller userInfo={userInfo} handleLogout={handleLogout} />
            ) : (
              <Navigate to="/" />
            )}
          />
          <Route
            path="/Profile"
            element={loggedIn ? (
              <Profile userInfo={userInfo} handleLogout={handleLogout} />
            ) : (
              <Navigate to="/" />
            )}
          />
          <Route
            path="/HardwareManagement"
            element={loggedIn ? (
              <HardwareManagement userInfo={userInfo} handleLogout={handleLogout} />
            ) : (
              <Navigate to="/" />
            )}
          />
          <Route
            path="/PricingManagement"
            element={loggedIn ? (
              <PricingManagement userInfo={userInfo} handleLogout={handleLogout} />
            ) : (
              <Navigate to="/" />
            )}
          />
          <Route
            path="/OccupantManagement"
            element={loggedIn ? (
              <OccupantManagement userInfo={userInfo} handleLogout={handleLogout} />
            ) : (
              <Navigate to="/" />
            )}
          />
          <Route
            path="/AccessManagement"
            element={loggedIn ? (
              <AccessManagement userInfo={userInfo} handleLogout={handleLogout} />
            ) : (
              <Navigate to="/" />
            )}
          />
        </Routes>
      </div>
    </div>
  );
};

export default SuperAdminApp;
